import GoodsListComp from './GoodsListStyle.js';

export default function Order() {
  return (
    <GoodsListComp>
      <div className='container'>
        <h2>상품 리스트 출력 페이지</h2>
        <div className='body'>
          <h2>자주 산 상품</h2>
          <section className='list1'>
            <div class='goodslist'></div>
          </section>
          <h2>판매특가</h2>
          <section className='list2'></section>
        </div>
      </div>
    </GoodsListComp>
  );
}
